import styles from "../styles/_hamburgerMenu.module.scss";

const HamburgerMenu = () => {
    return (
        <>
            <div>
                <div className={styles.hamburger}>
                    <input className={styles.input} type="checkbox" />
                    <div className={styles.hamburger_lines}>
                        <span
                            // className={styles.lines + "" + styles.line1}
                            className={styles.lines + "" + styles.line1}
                        ></span>
                        <span
                            className={styles.lines + "" + styles.line2}
                        ></span>
                        <span
                            className={styles.lines + "" + styles.line3}
                        ></span>
                    </div>
                    <ul className={styles.menu_items}>
                        <li className={styles.li}>Home</li>
                        <li className={styles.li}>About</li>
                        <li className={styles.li}>Contact</li>
                        <li className={styles.li}>Blog</li>
                        <li className={styles.li}>Log Out</li>
                    </ul>
                </div>
            </div>
        </>
    );
};

export default HamburgerMenu;
